-- ----------------------------
-- Table structure for sys_menu_copy1
-- ----------------------------
DROP TABLE IF EXISTS "public"."sys_menu_copy1";
CREATE TABLE "public"."sys_menu_copy1" (
  "menu_id" int8 NOT NULL DEFAULT nextval('sys_table_id_seq'::regclass),
  "menu_name" varchar(50) COLLATE "pg_catalog"."default" NOT NULL,
  "parent_id" int8,
  "order_num" int4,
  "path" varchar(200) COLLATE "pg_catalog"."default",
  "component" varchar(255) COLLATE "pg_catalog"."default",
  "is_frame" char(1) COLLATE "pg_catalog"."default",
  "is_cache" char(1) COLLATE "pg_catalog"."default",
  "menu_type" char(1) COLLATE "pg_catalog"."default",
  "visible" char(1) COLLATE "pg_catalog"."default",
  "status" char(1) COLLATE "pg_catalog"."default",
  "perms" varchar(100) COLLATE "pg_catalog"."default",
  "icon" varchar(100) COLLATE "pg_catalog"."default",
  "create_by" varchar(64) COLLATE "pg_catalog"."default",
  "create_time" timestamp(6),
  "update_by" varchar(64) COLLATE "pg_catalog"."default",
  "update_time" timestamp(6),
  "remark" varchar(500) COLLATE "pg_catalog"."default"
)
;
COMMENT ON COLUMN "public"."sys_menu_copy1"."menu_id" IS '菜单ID';
COMMENT ON COLUMN "public"."sys_menu_copy1"."menu_name" IS '菜单名称';
COMMENT ON COLUMN "public"."sys_menu_copy1"."parent_id" IS '父菜单ID';
COMMENT ON COLUMN "public"."sys_menu_copy1"."order_num" IS '显示顺序';
COMMENT ON COLUMN "public"."sys_menu_copy1"."path" IS '路由地址';
COMMENT ON COLUMN "public"."sys_menu_copy1"."component" IS '组件路径';
COMMENT ON COLUMN "public"."sys_menu_copy1"."is_frame" IS '是否为外链（0是 1否）';
COMMENT ON COLUMN "public"."sys_menu_copy1"."is_cache" IS '是否缓存（0缓存 1不缓存）';
COMMENT ON COLUMN "public"."sys_menu_copy1"."menu_type" IS '菜单类型（M目录 C菜单 F按钮）';
COMMENT ON COLUMN "public"."sys_menu_copy1"."visible" IS '菜单状态（0显示 1隐藏）';
COMMENT ON COLUMN "public"."sys_menu_copy1"."status" IS '菜单状态（0正常 1停用）';
COMMENT ON COLUMN "public"."sys_menu_copy1"."perms" IS '权限标识';
COMMENT ON COLUMN "public"."sys_menu_copy1"."icon" IS '菜单图标';
COMMENT ON COLUMN "public"."sys_menu_copy1"."create_by" IS '创建者';
COMMENT ON COLUMN "public"."sys_menu_copy1"."create_time" IS '创建时间';
COMMENT ON COLUMN "public"."sys_menu_copy1"."update_by" IS '更新者';
COMMENT ON COLUMN "public"."sys_menu_copy1"."update_time" IS '更新时间';
COMMENT ON COLUMN "public"."sys_menu_copy1"."remark" IS '备注';
COMMENT ON TABLE "public"."sys_menu_copy1" IS '菜单权限表';

